// InterpolPage.js
import React, { useState, useEffect } from 'react';
import PersonCard from './FbiPersonCard';

const InterpolPage = () => {
  const [interpolPersons, setInterpolPersons] = useState([]);

  useEffect(() => {
    fetch('https://vigilant-api-a2xyukeyka-uc.a.run.app/interpol/getallnotices?page=1')
      .then((response) => response.json())
      .then((data) => setInterpolPersons(data))
      .catch((error) => console.error('Erro ao buscar dados da Interpol:', error));
  }, []);

  return (
    <div className="container mt-3">
      <div className="row">
        {interpolPersons.map((person) => (
          <div key={person.id} className="col-md-4">
            <PersonCard person={person} />
          </div>
        ))}
      </div>
    </div>
  );
};

export default InterpolPage;
